import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata";

const App = () => (
  <>
<h1> My top netflix movies</h1>
  {Sdata.map((val) => {   // Using fat arrow function
    return (
    <Card 
      imgsrc={val.imgsrc}
      title={val.title}
      name={val.name}
      link={val.Link}
    />
  );
  })}
  </>
);
export default App;
